export default function GetGameData(data) {

    const GameData = {
        'date': data.gdtutc,
        'time': data.utctm,
        'city': data.ac,
        'state': data.as,
        'home': data.hls.ta,
        'away': data.vls.ta,
        'status': data.stt,
        'lastPlay': data.lpla.de
    };

    return GameData;
}
